import React from 'react';

const Contact = () => {
  return (
    <section className="p-10 max-w-lg mx-auto">
      <h2 className="text-3xl font-bold mb-4">Contact</h2>
      <p className="text-gray-700 mb-4">
        Feel free to reach out to me at:
      </p>
      <ul className="text-blue-600 space-y-2">
        <li>Email: <a href="mailto:ayush@example.com" className="underline">ayush@example.com</a></li>
        <li>LinkedIn: <a href="https://linkedin.com/in/ayush" className="underline" target="_blank" rel="noreferrer">linkedin.com/in/ayush</a></li>
        <li>GitHub: <a href="https://github.com/ayush" className="underline" target="_blank" rel="noreferrer">github.com/ayush</a></li>
      </ul>
    </section>
  );
};

export default Contact;
